import './style.css'

const navbar = () => {
    return (
        <nav>
            <div className='md:flex bg-color-primary'>
                <div className='text-white py-5 text-xl'>
                    Yohanes.
                    <span>
                        Albert
                    </span>
                </div>
            </div>
        </nav>
    )
}

export default navbar;
